package com.onebill.training.day6;

public class TwoDimensionalDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[][] integerTwoDArray = new int[3][4];
		for(int i=0;i<3;i++)
		{
			for(int j=0;j<4;j++)
			{
				System.out.print(integerTwoDArray[i][j]);
			}
			System.out.println();
		}

	}

}
